import React from 'react';
import s from './Navbar.module.css'
import {NavLink} from "react-router-dom";
import {BrowserRouter, Router, Routes, Route, Switch} from "react-router-dom";

const Navbar = (props) => {
  return (
        <navbar className={s.navbar}>
          <NavLink className={s.logo} to={"/"}><span className={s.logoLetterE}>e</span>-board</NavLink>
          <input className={s.input} type="text" value={'Поиск'}/>
          <NavLink className={s.btnLink} to={'/ad/search'}><button className={`${s.btn} ${s.button}`}>Поиск</button></NavLink>
          <button className={`${s.btn} ${s.button}`}><NavLink className={s.btnLink} to={'/ad/create'}>Разместить
            объявление</NavLink></button>
          <button className={`${s.btn} ${s.buttonActive}`}><NavLink className={s.btnLinkActive}
                                                                    to={'/login'}>Войти</NavLink></button>
        </navbar>
  );
};

export default Navbar;
